import React, { useState, useEffect } from 'react';
import axios from 'axios';

const GetRestaurantData = () => {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(
                    'http://apis.data.go.kr/B551011/KorService1/areaBasedList1', {
                        params: {
                            numOfRows: 10,
                            pageNo: 1,
                            MobileOS: 'ETC',
                            MobileApp: 'TestApp',
                            serviceKey: '5V%2BytDDcz11Mfxc3tREUmoX6wOvDmA3oIaBkQfhB%2Bo%2B4vBWem3h6eQhKVvJuiJvpVonGtnuRqU6A83YSSBAh8A%3D%3D',
                            _type: 'json',
                            listYN: 'Y',
                            arrange: 'A',
                            contentTypeId: '39',
                            areaCode: '4',
                            sigunguCode: '4',
                            cat1: 'A05',
                            cat2: '',
                            cat3: '',
                            modifiedtime: '',
                        }
                    }
                );
                const json = await response.json();
                console.log(json.response.body.items.item);
                setLoading(false);
            } catch (err) {
                setError(err);
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    if (loading) {
        return <div>Loading...</div>;
    }

    if (error) {
        return <div>Error: {error.message}</div>;
    }

    return (
        <div>
            <h1>API Data</h1>
            <ul>
                {data.map((item) => (
                    <li key={item.contentid}>{item.title}</li>
                ))}
            </ul>
        </div>
    );
};


export default GetRestaurantData;
